Havelock Ellis was the central figure in the emergence of the modern sexual ethos. (Paul Robinson, &quot;The modernization of sex. Havelock Ellis, Alfred Kinsey, William Masters and Virginia Johnson&quot;)



Studies in the Psychology of Sex (1897-1910)

Volume I: The Evolution of Modesty; The Phenomena of Sexual Periodicity; Auto-Erotism
Volume II: Sexual Inversion
Volume III: Analysis of the Sexual Impulse; Love and Pain; The Sexual Impulse in Women
Volume IV: Sexual Selection in Man
Volume V: Erotic Symbolism; The Mechanism of Detumescence; The Psychic State in Pregnancy
Volume VI: Sex in Relation to Society


